CREATE DEFINER=`root`@`localhost` PROCEDURE `MinusQuantity` (IN `warehouse_id` INT, IN `product_id` INT, IN `new_quantity` DOUBLE, IN `old_quantity` DOUBLE)   BEGIN
DECLARE total DOUBLE;
IF old_quantity > -1 THEN
SET total = old_quantity - new_quantity;
ELSE
SET total = new_quantity;
END IF;
IF NOT EXISTS (
        SELECT 1
        FROM inventory
        WHERE inventory.ProductID = product_id
                AND inventory.WarehouseID = warehouse_id
) THEN -- If not, add the product to the stock table
VALUES (product_id, warehouse_id, -1*total);
